window.bookSummaryJSON = "<p>From the <i>New York Times</i> best-selling author of <i>Take the Stairs</i> - a bold new way to get things done. </p> <p><i>New York Times</i> best-selling author and sales-performance trainer Rory Vaden brings his high-energy approach and can-do spirit to the most nagging problem in our professional lives: stalled productivity. Millions are overworked, organizationally challenged, or have a motivation issue that's holding them back. Vaden presents a simple yet powerful paradigm that will set listeners free to do their best work - on time and without stress and anxiety.</p>"; 
